Here is a sample code for a chrome extension that takes screenshots of the current tab and saves them to a folder on your computer:
```
// manifest.json
{
  "name": "Screenshot Extension",
  "version": "1.0",
  "description": "Takes screenshots of the current tab and saves them to a folder on your computer.",
  "manifest_version": 2,
  "background": {
    "scripts": ["background.js"]
  },
  "permissions": [
    "activeTab",
    "tabs",
    "storage"
  ]
}

// background.js
chrome.tabs.onUpdated.addListener(function(tabId, changeInfo, tab) {
  if (changeInfo.status === "complete") {
    chrome.tabs.captureVisibleTab(null, {}, function(dataUrl) {
      var filename = "screenshot-" + Date.now() + ".png";
      chrome.storage.local.set({filename: filename}, function() {
        chrome.downloads.download({
          url: dataUrl,
          filename: filename,
          saveAs: false
        });
      });
    });
  }
});

// settings.html
<!DOCTYPE html>
<html>
  <head>
    <title>Screenshot Extension Settings</title>
    <script src="settings.js"></script>
  </head>
  <body>
    <h1>Screenshot Extension Settings</h1>
    <p>Choose a folder to save screenshots to:</p>
    <input type="text" id="folder" placeholder="Folder path">
    <button id="save">Save</button>
  </body>
</html>

// settings.js
document.getElementById("save").addEventListener("click", function() {
  var folder = document.getElementById("folder").value;
  chrome.storage.local.set({folder: folder}, function() {
    alert("Settings saved!");
  });
});
```
In this code, we first define the manifest.json file, which specifies the name, version, description, and permissions of the extension. We also specify that the background script should be loaded when the extension is installed.

Next, we define the background.js file, which listens for changes to the current tab and takes a screenshot of it when the tab is fully loaded. The screenshot is saved to a file named "screenshot-<timestamp>.png" in the current directory.

Finally, we define the settings.html file, which allows the user to specify the folder to save screenshots to. When the user clicks the "Save" button, the folder path is saved to local storage and an alert is displayed to confirm that the settings have been saved.

