. The function should take a post object as an argument and return the elapsed time in seconds. The post object should have a property called "timestamp" which is a number representing the number of seconds since the Unix epoch (January 1, 1970).

For example, if the current time is 2022-01-01 00:00:00 and the post was made at 2021-12-31 23:59:59, the elapsed time would be 1 second.

You can use the Date object to get the current time and the post timestamp. You can use the Math.floor() function to round the elapsed time to the nearest second.

```typescript
function getElapsedTime(post: { timestamp: number }): number {
  const now = new Date();
  const postTimestamp = new Date(post.timestamp);
  const elapsedSeconds = Math.floor((now.getTime() - postTimestamp.getTime()) / 1000);
  return elapsedSeconds;
}
```

